import Right from "../components/rightbtn";
import Left from "../components/leftbtn";
import "./wrapped.css";
import { useEffect, } from "react";
function One(props){
    useEffect(() => {
        setTimeout(() => {
          window.location.href="/wrapped/2"
        }, 30000)
      }, [])
    return(
        <>
        <div className="one">
            <Left path="4"></Left>
            <Right  path="2"></Right>
            <center>
                {/* first text starts */}
            <h2 className="text-5xl one-text">2023 Wrapped<br></br>Coding</h2>
            {/* first text ends */}
            <h2 className="text-5xl two-text">Hello {props.name}<br></br>Its Wrapped Time Ready?Lets do This!</h2>
            </center>
       
        </div>
        
        </>
    )
}
export default One;
